class DOMString:

    def remove_tag_content(self, soup, tag_name):
        """
        去除标签文本
        :param tag_name: string
        :return: soup
        """
        for tag in soup.find_all(tag_name):
            tag.clear()

    def remove_all_tags(self, soup):
        '''
        去除指定标签文本
        :param soup:
        :return:
        '''
        tag_list = ["a", "title", "h2", "li", "span", "button"]
        for tag in tag_list:
            self.remove_tag_content(soup, tag)
        return soup

    def get_domdict(self):
        '''
        计算DOM的Levenshtein距离
        :return:
        '''
        path = os.path.join(base_dir, 'doms')
        # print(path)
        files = os.listdir(path)
        dic_DOMLev = {}
        print("-------------DOMLev计算开始---------------")
        for file1 in files:
            html_doc1 = open(os.path.join(path, file1), encoding="unicode_escape").read()
            soup = BeautifulSoup(html_doc1, 'html.parser')
            result_dom1 = self.remove_all_tags(soup)
            string_dom1 = str(result_dom1).replace('\n', '')
            dic_DOMLev[file1] = {}
            for file2 in files:
                html_doc2 = open(os.path.join(path, file2), encoding="unicode_escape").read()
                soup = BeautifulSoup(html_doc2, 'html.parser')
                result_dom2 = self.remove_all_tags(soup)
                string_dom2 = str(result_dom2).replace('\n', '')
                l = Levenshtein.ratio(string_dom1, string_dom2)
                dic_DOMLev[file1][file2] = format(l, '.2f')
        # print(dic_DOMLev)
        return dic_DOMLev
